// utility functions

// リストのappend
const appendLists = function (l1, l2){
    for (let e of l2)
        l1.push(e);
    return l1;
}

// 指定した難易度の曲を取得
const getMusicsByDiff = function (diffList){
    let result = [];
    for (let diff of diffList)
        appendLists(result,constantTable.filter(m => m.difficulty == diff));
    return result;
}

// バージョンにおける，特定のレベルを取得
const getMusicsByLevel = function (version, lvList){
    let result = [];
    for (let lv of lvList)
        appendLists(result, constantTable.filter(m => m.constant[version] == lv));
    return result;
}

const difficultyToId = function(str) {
    return (str == 'master') ? 3 : (str == 'expert') ? 2 : (str == 'advanced') ? 1 : 0;
}

const idToDifficulty = function(id) {
    return (id == 3) ? 'master' : (id == 2) ? 'expert' : (id == 1) ? 'advanced' : 'basic'
}

const versionToId = function(str) {
    return (str == 'origin') ? 0 : (str == 'plus') ? 1 : (str == 'air') ? 2 : (str == 'airplus') ? 3 : (str == 'star') ? 4 : (str == 'starplus') ? 5 : DEFAULTVERSION;
}

// スコアが無い曲の情報を取得(主に新曲用)
const getNewMusic = function(mboxList){
    let result = [];
    for (let m of mboxList){
        // "LEVEL 13"といった要素は飛ばす
        if(m.classList[0] == 'box01_title')
            continue;

        // プレイ済みのものは飛ばす(12以上は全曲触ってるため)
        if(m.getElementsByClassName('play_musicdata_highscore').length != 0)
            continue;
        
        result.push(m);
    }
    return result;
}

const getNewMusicInfo = function (){
    const musicDetail = document.getElementById('music_detail');
    let result = [];
    for (let box01 of musicDetail.children)
        appendLists(result, getNewMusic(box01.children));
    return result;
}
